pragma solidity ^0.5.1;
pragma experimental ABIEncoderV2;

contract InvoiceManager {

    struct invoiceInfo {
      uint256 bankNo;
      bytes32[] dataHash;
      uint256 status;
    }

    mapping(uint256 => invoiceInfo) public invoiceStorage;
    uint256 public numOfInvoices;

    address public adminAddress;
    address public owner;

    constructor(
        address _adminAddress
    ) public {
        adminAddress = _adminAddress;
        owner = msg.sender;
        numOfInvoices = 0;
    }

    /* prepend a check that function is called by admin address */
    modifier onlyAdmin {
        require(msg.sender == adminAddress, 'only admin has access');
        _;
    }

    /* prepend a check that function is called by owner address */
    modifier onlyOwner {
        require(msg.sender == owner, 'only owner has access');
        _;
    }

    function stringToBytes32(string memory source) public view returns (bytes32 result) {
        bytes memory tempEmptyStringTest = bytes(source);
        if (tempEmptyStringTest.length == 0) {
            return 0x0;
        }
        assembly {
            result := mload(add(source, 32))
        }
    }

    function getBankNo(uint256 _invoiceID) public view returns(uint256) {
        return invoiceStorage[_invoiceID].bankNo;
    }

    function getDataHash(uint256 _invoiceID) public view returns(bytes32[] memory) {
        return invoiceStorage[_invoiceID].dataHash;
    }

    function getStatus(uint256 _invoiceID) public view returns(uint256) {
        return invoiceStorage[_invoiceID].status;
    }

    function setStatus(uint256 _invoiceID, uint256 _status) public {
        invoiceStorage[_invoiceID].status = _status;
    }

    function addInvoice(uint256 _bankNo, bytes32[] memory _dataHash, uint256 _timestamp)
        public
        returns (uint256)
    {
        uint256 invoiceID = numOfInvoices;
        numOfInvoices++;
        invoiceInfo memory newInvoice = invoiceInfo(_bankNo, _dataHash, 0);
        invoiceStorage[invoiceID] = newInvoice;
        return invoiceID;
    }

    /* finds exact match index, duplicate indexes and performs duplicate scoring */
    function findDuplicateInvoices(uint256 _bankNo, bytes32[] memory _dataHash)
        public
        view
        returns (bool, bool, uint256, uint256, uint256[] memory, uint256[] memory)
    {
        bool sameBank = false;
        bool sameInvoice = false;
        uint256 invoiceIndex = 0;
        uint256 numOfDuplicates = 0;
        uint256[] memory duplicateIndexes;
        uint256[] memory duplicateInvoiceScoring;

        for (uint256 i = 0; i < numOfInvoices; i++) {
            /* scoring algorithm here */
            if((invoiceStorage[i].dataHash)[0] == _dataHash[0]) { // FIX: only compares first hash value
              invoiceIndex = i;
              duplicateIndexes[invoiceIndex] = i;
              duplicateInvoiceScoring[invoiceIndex] = 100;
              numOfDuplicates++;
              if (invoiceStorage[i].bankNo == _bankNo) {
                sameBank = true;
              }
            }
        }
        return (sameBank, sameInvoice, invoiceIndex, numOfDuplicates, duplicateIndexes, duplicateInvoiceScoring);
    }

    function checkDuplicatesStatus(uint256[] memory _duplicateIndexes, uint256[] memory _validStatus)
        public
        view
        returns (bool)
    {
        bool statusesFound = true;
        for (uint256 i = 0; i < _duplicateIndexes.length; i++) {
          bool statusFound = false;
          for(uint256 j = 0; j < _validStatus.length; j++) {
            if(getStatus(_duplicateIndexes[i]) == _validStatus[j]) {
              statusFound = true;
              break;
            }
          }
          if(statusFound == false) { // invoice status not valid
            statusesFound = false;
            break;
          }
        }
        return (statusesFound);
    }

    function approveInvoice(uint256 _bankNo, bytes32[] memory _dataHash, uint256 _timestamp)
        public
        returns (bool)
    {
        bool sameBank = false;
        bool sameInvoice = false;
        uint256 invoiceIndex = 0;
        uint256 numOfDuplicates = 0;
        uint256[] memory duplicateIndexes;
        uint256[] memory duplicateInvoiceScoring;
        (sameBank, sameInvoice, invoiceIndex, numOfDuplicates, duplicateIndexes, duplicateInvoiceScoring) = findDuplicateInvoices(_bankNo, _dataHash);

        bool error = false;

        if (sameInvoice) { // find same invoice hash
            if(sameBank) { // find same invoice hash and same bank no
              if (getStatus(invoiceIndex) == 3) {
                setStatus(invoiceIndex, 1);
              } else {
                /* need to change invoice status ??? */
                error = true;
              }
            } else {
              if (numOfDuplicates > 1) {
                /* FIX: forced to init a dynamic array */
                uint256[] memory tempArray67;
                tempArray67[0] = 6;
                tempArray67[1] = 7;
                uint256[] memory tempArray4;
                tempArray4[0] = 4;
                uint256[] memory tempArray8;
                tempArray8[0] = 8;
                if (checkDuplicatesStatus(duplicateIndexes, tempArray67)) {
                  setStatus(invoiceIndex, 5);
                } else if (checkDuplicatesStatus(duplicateIndexes, tempArray4)) {
                  setStatus(invoiceIndex, 4);
                } else if (checkDuplicatesStatus(duplicateIndexes, tempArray8)) {
                  setStatus(invoiceIndex, 1);
                }
              } else if (numOfDuplicates == 1) {
                if (getStatus(duplicateIndexes[0]) == 1) {
                  setStatus(invoiceIndex, 4);
                  setStatus(duplicateIndexes[0], 4);
                } else if (getStatus(duplicateIndexes[0]) == 2) {
                  setStatus(invoiceIndex, 5);
                  setStatus(duplicateIndexes[0], 6);
                } else if (getStatus(duplicateIndexes[0]) == 3) {
                  setStatus(invoiceIndex, 1);
                  setStatus(duplicateIndexes[0], 8);
                }
              }
            }
        } else { // add new invoice and approve it
            /* fix does add invoice return the invoice id??? */
            setStatus(addInvoice(_bankNo, _dataHash, _timestamp), 1);
        }
        return error;
    }

    /* approve an Invoice
            check exact
                    if no exact found, approve
                    else if exact found
                            check duplicates
                                    if no duplicates exist
                                            check status
                                                    if invoice status reversed
                                                            approve invoice
                                                    else status 10
                                    else if duplicates exist
                                            check number of duplicates
                                                    if only 1 duplicate
                                                            if duplicate status is approved
                                                                    set current invoice status to status 4
                                                                    set duplicate status to status 4
                                                            if duplicate status is financed
                                                                    set current invoice status to status 5
                                                                    set duplicate status to status 6
                                                            if duplicate status is reversed
                                                                    set current invoice status to status 1
                                                                    set duplicate status to status 8
                                                            else status 10
                                                    else if more than 1 duplicate
                                                            if duplicates contain status 6 or 7
                                                                    set current invoice status to status 5
                                                            if duplicates are only status 4
                                                                    set current invoice status to status 4
                                                            if duplicates are only status 8
                                                                    set current invoice status to status 1
                                                            else status 10
    finance an Invoice

    reverse an Invoice */


}
